import React from "react";

const ProgrammingSkills = ({ programming }) => {
    return (
        <li>
            <div className="p-item2">
                {programming.language}
                <div>
                <span className={`programming-item ${programming.id}`}></span> 
                </div>  
            </div>
        </li>
    )
}

export default ProgrammingSkills;
